import React from "react";

//Material UI
import { Typography, Grid } from "@material-ui/core";
import { PinterestIcon } from "@material-ui/icons";

import FooterLinks from "../footerLinks/footerLinks.component";

import Background from "../../assets/images/backgrounds/wave_3.png";

const Footer = () => {
  return (
    <Grid
      container
      justify="space-between"
      alignItems="center"
      xs={12}
      style={{
        backgroundColor: "#00539c",
        backgroundImage: "url(" + Background + ")",
        backgroundSize: "100% 44px",
        backgroundRepeat: "no-repeat",
        paddingTop: "56px",
      }}
    >
      <Grid item xs={11} md={3}>
        <Typography
          style={{
            color: "white",
            fontFamily: "lobster",
            margin: "33px",
            fontSize: "19px",
            textShadow: "5px 5px 10px blue, 5px 5px 10px cyan",
          }}
          align="center"
          variant="h3"
        >
          YousFitness - Clothing
        </Typography>
      </Grid>
      <Grid
        item
        justify="center"
        xs={11}
        md={6}
        style={{
          color: "white",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <FooterLinks />
      </Grid>
      <Grid container xs={11} md={3}>
        <Grid item justify="center" xs={4}>
          <PinterestIcon />
        </Grid>
        <Grid item justify="center" xs={4}>
          <PinterestIcon />
        </Grid>
        <Grid item justify="center" xs={4}>
          <PinterestIcon />
        </Grid>
      </Grid>
    </Grid>
  );
};

export default Footer;
